import React from "react";
import {
  FaHtml5, FaCss3Alt, FaJs, FaPython, FaJava, FaReact, FaNodeJs,
  FaAws, FaGitAlt, FaGithub, FaAndroid, FaFigma, FaCode
} from "react-icons/fa";

import {
  SiExpress, SiMongodb, SiPostman, SiCanva, SiDart,
  SiMachinelearning, SiFirebase, SiBootstrap, SiTailwindcss, SiMysql
} from "react-icons/si";

import { TbBrain, TbLanguage } from "react-icons/tb";
import { AiOutlineEye } from "react-icons/ai";

import "./Skills.css";

const skills = [
  { icon: <FaHtml5 />, name: "HTML" },
  { icon: <FaCss3Alt />, name: "CSS" },
  { icon: <FaJs />, name: "JavaScript" },
  { icon: <FaPython />, name: "Python" },
  { icon: <FaJava />, name: "Java" },
  { icon: <SiDart />, name: "Dart" },
  { icon: <FaReact />, name: "React" },
  { icon: <FaReact />, name: "React Native" },
  { icon: <FaNodeJs />, name: "Node.js" },
  { icon: <SiExpress />, name: "Express" },
  { icon: <SiMachinelearning />, name: "Machine Learning" },
  { icon: <TbBrain />, name: "Deep Learning" },
  { icon: <TbLanguage />, name: "Natural Language Processing" },
  { icon: <AiOutlineEye />, name: "Computer Vision" },
  { icon: <FaAws />, name: "AWS" },
  { icon: <FaGitAlt />, name: "Git" },
  { icon: <FaGithub />, name: "GitHub" },
  { icon: <SiPostman />, name: "Postman" },
  { icon: <FaAndroid />, name: "Android Studio" },
  { icon: <FaCode />, name: "VS Code" },
  { icon: <SiMongodb />, name: "MongoDB" },
  { icon: <SiMysql />, name: "MySQL" },
  { icon: <SiTailwindcss />, name: "Tailwind CSS" },
  { icon: <SiBootstrap />, name: "Bootstrap" },
  { icon: <SiFirebase />, name: "Firebase" },
  { icon: <FaFigma />, name: "Figma" },
  { icon: <SiCanva />, name: "Canva" },
];

const Skills = () => {
  return (
    <section id="skills" className="skills-section">
      <h2 className="section-title">My Skills</h2>
      <div className="skills-grid">
        {skills.map((skill, index) => (
          <div className="skill-card" key={index}>
            <div className="icon">{skill.icon}</div>
            <p>{skill.name}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Skills;
